bio:
Tech-addicted entrepreneur (3 x failed startups, 2 x small business exits), product creator, software engineer, speaker, passionate leader.

Being tech-addicted since 2003 started a professional career in 2006 as a Software engineer writing low-level software and drivers for earth-based satellite stations using C++ and ASM stack under RHAS and KDevelop environments. 

In 2009 graduated the BMSTU with a Master's degree in Theoretic physics and nano-technology in radio electronics. I did my thesis on the facilities of a 40m-diameter electron storage ring SIBERIA-2 for the design and construction of the micromechanical gyroscope-accelerometer. Such kind of device is used a lot nowadays in every mobile phone to manage the orientation of your screen.

By 2015 was involved in dozens of tech-projects as a Software engineer and an Architect and was honored with the Appreciation letter for the Intelligent traffic system developed and launched during the Winter Olympic Games in Sochi 2014. During this period of time, I had hands-on experience using in production a huge set of different programming languages: Delphi, Java EE, C#, PHP, C++, Python, JavaScript, Objective-C and still find myself stack-agnostic finding most of the issues in communication and business rather than in the technology itself. 

In 2016 graduated from the Innopolis University with a Master's degree in Software Engineering backed by MSIT SE  CMU original program with GPA 4.06 and opened the Innosoft software company specialized in computer vision, ML, and blockchain technology. Since this period of time 200% involved in building our own tech product YORSO (www.yorso.com) as a CEO and ex-CTO. 

In 2017-2018 was heavily involved in the blockchain activities as a fundraiser, developer, speaker, judge. Became a member of PulsarVC to lead the track related to decentralized ledgers.

In 2019 graduated from the #500Startups & Sberbank acceleration program as a TOP7 team and the best demo day pitch; afterward was honored as a TOP Ocean and Seafood technology at Stanford during Fish 2.0 initiative final with YORSO. 

Since March 2020 is working on a new venture.

